import React from "react";
import horse from '../images/horse.png'

function Dashboard(){
    return (
        <div className="dashboard">
            <p> There is Dashboard </p>
            <a href='https://google.com.tw/'>前往google</a>
            <p> 這是草你馬 </p>
            <img src={horse}/>
        </div>
    );
}

export default Dashboard;
